docs/20.有效的括号.html.body:
有效的括号


给定一个只包括 '('，')'，'{'，'}'，'['，']' 的字符串，判断字符串是否有效。
有效字符串需满足：

左括号必须用相同类型的右括号闭合。
左括号必须以正确的顺序闭合。
注意空字符串可被认为是有效字符串。




输入
输出




输入: "()"
输出: true


输入: "()[]{}"
输出: true


输入: "(]"
输出: false


输入: "([)]"
输出: false


输入: "{[]}"
输出: true



解法一
var isValid = function (s) {
    while (s.length) {
        var temp = s;
        s = s.replace('()', '').replace('[]', '').replace('{}', '');
    }
    return s.length === 0;
};

 时间复杂度为 ：O(n^2/2)
这一思路有点暴力，逻辑也很直接，代码上看起来也很简单明了，但是它的时间复杂度也很难把控。
解法二（堆栈思路）
换一种思路，可以边遍历边匹配。也就是遍历的时候遇到左括号存入数组，下次遇到的第一个右括号必须和数组中最后一个元素匹配，否则为无效字符串，匹配完成后从数组中删除此元素。若最终数组为空，表示括号已全部匹配完，字符串有效。
var isValid = function (s) {
    var map = {
        "(": ")",
        "[": "]",
        "{": "}"
    } // 写一个字典，建立匹配规则
    var leftArr = []
    for (var ch of s){
        if (ch in map) leftArr.push(ch); //为左括号时，顺序保存
        else { //为右括号时，与数组末位匹配
            if(ch != map[leftArr.pop()]) return false;
        }
    }
    return !leftArr.length //防止全部为左括号
};

解法二的变形（堆栈思路）
时间复杂度：O(n) 只需要for循环这一次遍历
空间复杂度：O(n) 每个元素最多被压栈一次

var isValid = function(s) {
    var map = {
        ")": "(",
        "]": "[",
        "}": "{"
    } // 写一个字典，建立对应关系
    var stack = []
    for(let key of s){
        if(!map.hasOwnProperty(key)){
            stack.push(key)
        }else{
            if(stack.pop() != map[key]){
                return false
            }
        }
    }
    return !stack.length;
};

